device_option {
  device_type : 0
  device_id : 0
}

op {
  name : "constant_fill"
  type : "ConstantFill"
  arg {
    name : "shape"
    ints : 2
    ints : 3
  }
  arg {
    name : "dtype"
    i : 1
  }
  arg {
    name : "value"
    floats : 0
    floats : 1
    floats : 1
    floats : 0
    floats : 0
    floats : 3
  }
